-- Escape Menu Detection + Restart Script
-- This script detects when the player opens their escape menu and restarts them

local Players = game:GetService("Players")
local GuiService = game:GetService("GuiService")
local TeleportService = game:GetService("TeleportService")

local player = Players.LocalPlayer
local hasRestarted = false -- Debounce to prevent multiple restarts

local function restartPlayer()
    if hasRestarted then return end -- Prevent multiple calls
    hasRestarted = true
    
    local jobId = game.JobId
    local placeId = game.PlaceId
    
    print("Restarting player...")
    -- Teleport the player back to the same server
    TeleportService:TeleportToPlaceInstance(placeId, jobId, player)
end

-- Using GuiService MenuOpened event (most reliable)
GuiService.MenuOpened:Connect(function()
    print("Menu opened - restarting player")
    restartPlayer()
end)

-- Note: The script will restart every time the player rejoins and opens the menu
-- This creates the "loop" effect you're looking for
